import React from "react";
import "../css/HInfo.css";
import hospitalbed from "../components/hospitalbed.png";
import reset from "../components/reset.png";
import greenHInfo from "../components/greenHInfo.png";
import yellowHInfo from "../components/yellowHInfo.png";
import orangeHInfo from "../components/orangeHInfo.png";
import redHInfo from "../components/redHInfo.png";

const hospital = {
  id: 1,
  name: "Gangnam General Hospital",
  address: "123 Gangnam-daero, Gangnam-gu, Seoul",
  location: "123 Gangnam-daero, Gangnam-gu, Seoul",
  phone: "02-1234-5678",
  Acongestion: 1,
  Pcongestion: 8,
  procedures: [
    "뇌출혈",
    "뇌경색의재관류",
    "심근경색의재관류",
    "복부손상의수술",
    "사지접합의수술",
    "응급내시경",
    "응급투석",
    "조산산모",
    "신생아",
    "중증화상",
  ],
  Available_Beds: [
    "응급실성인병상",
    "응급실소아병상",
    "수술실",
    "신경과중환자실",
    "신생아중환자실",
    "흉부외과중환자실",
    "일반중환자실",
    "내과중환자실",
    "외과중환자실",
    "신경외과중환자실",
    "CT",
    "MRI",
    "혈관촬영기",
    "인공호흡기",
    "CRRT",
  ],
  pro_lastUpdated: "2023-08-08 14:30",
  beds_lastUpdated: "2023-08-07 13:30",
};

const getCongestionImage = (congestionValue) => {
  if (congestionValue < 5) {
    return greenHInfo;
  } else if (congestionValue < 10) {
    return yellowHInfo;
  } else if (congestionValue < 15) {
    return orangeHInfo;
  } else {
    return redHInfo;
  }
};

const HInfo = () => {
  if (!hospital) {
    return <div>Error: No hospital information available.</div>;
  }

  return (
    <div className="hospital-details-container">
      <h1 className="hospital-name">{hospital.name}</h1>

      <div className="hospital-info-section emergency-section">
        {/* ... (응급실 혼잡도 섹션은 동일합니다) ... */}
      </div>

      <div className="hospital-info-section procedure-section">
        <div className="procedure-header">
          <div className="title-container">
            <h4 className="procedure-title">시술명 기준 현재 가능 응급의</h4>
            <span className="subtitle">해당 정보는 20분마다 갱신됩니다.</span>
            <span className="update-time">
              갱신시각: {hospital.pro_lastUpdated}
            </span>
          </div>
          <div className="header-right">
            <img src={reset} alt="Update" className="reset-icon" />
          </div>
        </div>
        <ul>
          {hospital.procedures.map((procedure, index) => (
            <li key={index} className="procedure-item">
              {procedure}
            </li>
          ))}
        </ul>
      </div>

      <div className="hospital-info-section procedure-section">
        <div className="procedure-header">
          <div className="title-container">
            <h4 className="procedure-title">
              실시간 가용병상 및 가용장비 정보
            </h4>
            <span className="subtitle">해당 정보는 10분마다 갱신됩니다.</span>
            <span className="update-time">
              갱신시각: {hospital.beds_lastUpdated}
            </span>
          </div>
          <div className="header-right">
            <img src={reset} alt="Update" className="reset-icon" />
          </div>
        </div>
        <ul>
          {hospital.Available_Beds.map((bed, index) => (
            <li key={index} className="procedure-item">
              {bed}
            </li>
          ))}
        </ul>
      </div>

      <div className="hospital-info-section">
        <img src={reset} alt="Location" className="info-icon" />
        <div className="info-content">
          <h3>Location</h3>
          <p>{hospital.location}</p>
        </div>
      </div>
    </div>
  );
};

export default HInfo;
